import './miCss.css';
import rey1 from './imagenes_actividad/rey_atanagildo.png';
import rey2 from './imagenes_actividad/rey_ataulfo.png';
import rey3 from './imagenes_actividad/rey_ervigio.png';
import rey4 from './imagenes_actividad/rey_incognito.png';
import rey5 from './imagenes_actividad/rey_leogivildo.png';
import rey6 from './imagenes_actividad/rey_recesvinto.png';
import rey7 from './imagenes_actividad/rey_sisebuto.png';
import rey8 from './imagenes_actividad/rey_teodorico.png';


function App() {
  let nombre=["Atanagildo","Ataulfo","Ervigio","Incognito","Leogivildo","Recesvinto","Sisebuto","Teodorico"];
  let caja = <div>Nombre</div>;
  return (
    <div className="fondo">
     <div className='reyes' id='rey1'>
       <img className='reyes_img' src={rey1}></img>
       <p>{nombre[0]}</p>
     </div>
     <div className='reyes' id='rey2'>
       <img className='reyes_img' src={rey2}></img>
       <p>{nombre[1]}</p>
     </div>
     <div className='reyes' id='rey3'>
       <img className='reyes_img' src={rey3}></img>
       <p>{nombre[2]}</p>
     </div>
     <div className='reyes' id='rey4'>
       <img className='reyes_img' src={rey4}></img>
       <p>{nombre[3]}</p>
     </div>
     <div className='reyes' id='rey5'>
       <img className='reyes_img' src={rey5}></img>
       <p>{nombre[4]}</p>
     </div>
     <div className='reyes' id='rey6'>
       <img className='reyes_img' src={rey6}></img>
       <p>{nombre[5]}</p>
     </div>
     <div className='reyes' id='rey7'>
        <img src={rey7}></img>
        <p>{nombre[6]}</p>
     </div>
     <div className='reyes' id='rey8'>
       <img src={rey8}></img>
       <p>{nombre[7]}</p>
     </div>
    </div>
  );
}

export default App;
